// import ProductItem from "./ProductItem";
import products from "../json/products.json";

export default function ProductList() {
  return (
    <div className="row">
      {products.map(
         product => {
            return (
              <>
                <h1 style={{ color: "white" }}>{product.name}</h1>
                <p style={{ color: "white" }}>{product.description}</p>
              </>
            );
         }
      )}
    </div>
  );
}
